import { useState } from 'react';
import './App.css';
import './App.scss';
import Attributes from './Components/Attributes';
import Board from './Components/Board';


function App() {
  const [winner , setWinner] = useState(null);
  const [player , setPlayer] = useState(null);
  const getData = (winner,player) => {
    setWinner(winner);
    setPlayer(player);
  }
  return (
    <div className="App">
      <Attributes winner={winner} player={player}/>
      <center><Board getData={(winner)=>getData(winner,player)}/></center>
    </div>
  );
}

export default App;
